package java_8_filter;

public class Car {
	
	String name;
	String model;
	
	public Car() {
		// TODO Auto-generated constructor stub
	}
	
	
	
	
	public Car(String name, String model) {
		super();
		this.name = name;
		this.model = model;
	}




	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getModel() {
		return model;
	}
	public void setModel(String model) {
		this.model = model;
	}
	
	

}
